                            </div>
                            <div className="nav-item active">
                                {/* <a className="nav-link  h3b" href="/resources"><strong>Resources</strong></a> */}
                                <li><Link to="/resources" className="nav-link  h3-black"><strong>Resources</strong></Link></li>
                            </div>
                        </ul>
                    </div>
                </div>
            </nav>
        )
    }
}

export default Header;
